import React from 'react';
import './Footer.css'; // Import CSS file for styling

const Footer = () => {
    return (
        <footer className="footer">
            <div className="footer-content">
                <p>&copy; 2023 MyResumeWebsite. All rights reserved.</p>
            </div>
        </footer>
    );
};

export default Footer;
